import React, { useState, useEffect } from "react";

/// Pass data to single board
const Board = (props) =>{
    return (
       <div> 
        <h2>Name: {props.name}</h2>
        <h3>Date: {props.date}</h3>
        <h3>Visited: {props.visited}</h3>
        </div>
    )
}

export default Board
